import React from "react";

const MainPage = () => {
  return (
    <div className="container mt-5">
      <h2 className="text-center">Welcome to the Pickleball Community!</h2>
      <p className="text-center">
        Explore and connect with other players, check out our products, and
        enjoy the game!
      </p>
    </div>
  );
};

export default MainPage;
